import React from 'react';

const CharacterDetail = (props) => {
  console.log(props);
  return (
    <article className='article' key={props.item.id}>
      <img className='article__img' src={props.item.image} alt={props.name} title={`picture of ${props.item.name}`}></img>
      <div className='article__text'>
        <h2 className='article__name'>{props.item.name}</h2>
        <p className='article__attribute'>Status: {props.item.status}</p>
        <p className='article__attribute'>Species: {props.item.specie}</p>
        <p className='article__attribute'>Origin: {props.item.origin}</p>
        <p className='article__attribute'>Episodes: {props.item.episodes}</p>
      </div>
    </article>
  );
};

export default CharacterDetail;
